import React, { Component } from 'react';
// import ReactDOM from 'react-dom';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import './App.css';
import { Animated } from 'react-animated-css';
import PetContainer from './components/PetContainer'

class Welcome extends Component {
  render() {
    // console.log(this.props)
    return (
      <div>
        <div>
          <PetContainer />
        </div>
        <div className="App">
          <header className="App-header">
            <img src="http://www.hslcnm.org/wp-content/uploads/2014/03/baby.jpg" className="App-logo" alt="pet" />
            <br/><br/><br/>
            <Animated animationIn="pulse" animationOut="flash" isVisible={true}>
              <p className="App-header-two">Adopt A Pet!</p>
            </Animated>
            <br></br>
            <Link className='App-link' to='/signin'>
              Sign-In
            </Link>
            <br></br>
            <Link className='App-link' to='/signup'>
              Sign-Up
            </Link>
          </header>
        </div>
      </div>
      );
  }
}

export default Welcome;
